import React, { useState } from 'react';
import { registerApi } from '../apis/Api';
import { toast } from 'react-toastify';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const Register = () => {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [phoneNo, setPhoneNo] = useState('');
  const [password, setPassword] = useState('');

  const changeFirstName = (e) => {
    setFirstName(e.target.value);
  };
  const changeLastName = (e) => {
    setLastName(e.target.value);
  };
  const changePhoneNo = (e) => {
    setPhoneNo(e.target.value);
  };
  const changePassword = (e) => {
    setPassword(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    console.log(firstName, lastName, phoneNo, password);

    const data = {
      firstName: firstName,
      lastName: lastName,
      phoneNo: phoneNo,
      password: password,
    };
    registerApi(data)
      .then((res) => {
        if (res.data.success === true) {
          toast.success(res.data.message);
        } else {
          toast.error(res.data.message);
        }
      })
      .catch((err) => {
        console.log(err);
        toast.error('Internal Server Error');
      });
  };
  const defaultTheme = createTheme();

  return (
    <div>
    <nav className="navbar navbar-expand-lg bg-body-tertiary">
     <div className="container-fluid">
     <div className="brands">
         <img src={Second} alt="second" class="px-2"/>
       <a className="navbar-brand" href="#">Second</a>
       </div>
       <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
       <span class="material-symbols-rounded">
   menu
   </span>
       </button>
      
       <div className="collapse navbar-collapse" id="navbarSupportedContent">
         <ul className="navbar-nav me-auto mb-2 mb-lg-0">
       
           <li className="nav-item">
           <form className="d-flex" role="search">
           <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
           <button className="search-btn" type="submit"><span class="material-symbols-rounded">
           search
   </span></button>
         </form>
           </li>
           <li className="nav-item ">
           <button className="sell-btn mx-2 px-2"> <img src={Plus}/>Sell</button> 
           </li>
           <div className="vl mx-2"></div>
           <li className="nav-item ">
           <button className="login-btns">login</button>
         
           </li>
           <li className="nav-item ">
             <Link to="/signup"> <button className="signup-btns mx-2 px-2">Sign Up</button> 
             </Link>
           </li>
          
         </ul>
       
       </div>
     </div>
   </nav>
   <div className="bodys d-lg-flex d-md-flex d-sm-block ">
   <div className="left-container p-5">
   <img src={Img1} alt="front image"/>
   </div>
   <div className="right-container  ">
   <div className="change-image">
   <Slider/>
   </div>
   <h2 className="pt-2 pb-2">
     Login
   </h2>
   <div className="login">
           <div className="login-form">
         
             <input className="login-input" type="email" name="email" placeholder="Email" required=""/>
           
             <Password/>
             <hr className="solid"/>
             <Link to ="/dashboard"><button className="login-btn">Login</button></Link>
             <h3 className="forget"><a>Forgot Password?</a></h3>
             <h3 className="pt-4">Don’t have an account?  <Link to="/signup"><span className="signup">Sign Up</span></Link></h3>
           </div>
         </div>
   </div>
   </div>
   
   <Footer/>
   
   
           </div>
  );
};

export default Register;
